import re

def pre_process_sample(sample_data_list):
    if sample_data_list:  
        items = []
        if isinstance(sample_data_list[0], str) : 
            for item in sample_data_list:
                item = item.strip()
                quote_match = re.match(r"'(.*)'|\"(.*)\"", item)
                if quote_match:
                    content = quote_match.group(1) or quote_match.group(2)
                    items.append(item)  # Keep original format, numeric or not
                else:
                    items.append(item)  # Unquoted item
            
            # Apply limit: only if all items are numeric (numbers or numeric strings)
            def is_numeric(s):
                try:
                    float(s.strip("'\""))  # Remove quotes for numeric check
                    return True
                except ValueError:
                    return False
            if isinstance(sample_data_list[0], str) : 
                if all(is_numeric(x) for x in items) and len(items) > 5:
                    sample_data = items[:5]  # Keep only first 5
                else:
                    sample_data = items[:30]  # Keep up to 30 for non-numeric
        else :
            sample_data = sample_data_list[:5]
    else:
        sample_data = []
    
    return sample_data

